disableMultiFactorMsg:"Tem a certeza que pretende desativar a autentica\u00e7\u00e3o multi-Fator para a sua organiza\u00e7\u00e3o? Esta a\u00e7\u00e3o ir\u00e1 remover o n\u00edvel extra de seguran\u00e7a de todas as contas de membros que a tenham ativado. Clique em OK e depois clique em Guardar na p\u00e1gina de Configura\u00e7\u00f5es para confirmar esta a\u00e7\u00e3o.",onceFederatedPortal:"Depois de configurar a federa\u00e7\u00e3o, os seus membros ser\u00e3o redirecionados automaticamente para os servidores web que fazem parte da sua empresa e que permitem aos utilizadores iniciarem sess\u00e3o na empresa. Os resultados desse in\u00edcio de sess\u00e3o s\u00e3o comunicados ao Portal for ArcGIS, que permite aos utilizadores trabalharem com os seus conte\u00fados no Portal for ArcGIS.",
