securityChanged:"A desativa\u00e7\u00e3o do SSL exige que inicie sess\u00e3o novamente.",anonTooltip:"Os utilizadores an\u00f3nimos poder\u00e3o apenas visualizar, aceder ou pesquisar recursos da organiza\u00e7\u00e3o que s\u00e3o partilhados para o p\u00fablico. Se ativar o acesso an\u00f3nimo, certifique-se que os grupos selecionados para Mapas em Destaque, Galeria, Galeria de Mapas Base e Modelos de Aplica\u00e7\u00f5es Web estejam partilhados para o p\u00fablico; Caso contr\u00e1rio, os utilizadores an\u00f3nimos poder\u00e3o n\u00e3o ser capazes de visualizar ou aceder ao conte\u00fado p\u00fablico destes grupos corretamente.",
pwdPolicyPortalDesc:"Pode definir uma pol\u00edtica de palavras-passe para todos os membros com contas integradas no seu portal para estabelecer regras que determinam o formato das palavras-passe que os membros podem escolher. Adicionalmente, pode definir a dura\u00e7\u00e3o das palavras-passe, bem como definir quantas palavras-passe introduzidas anteriormente s\u00e3o memorizadas e comparadas em termos de redund\u00e2ncia quando uma nova palavra -passe \u00e9 introduzida.",securedHostsSetting:"Servidores de Confian\u00e7a",
